import React, { Component } from 'react'
import { Card } from "react-bootstrap";

export class Todo_Item extends Component {
  render() {
    return (
      <div>
      <Card style={{ width: "18rem", margin: "20px auto", boxShadow: "2px 2px 10px rgba(0,0,0,0.1)" }}>
        <Card.Body>
          <Card.Title>this.props.todo.title</Card.Title>
          <Card.Text>{this.props.todo}</Card.Text>
       </Card.Body>
      </Card>
      </div>
    )
  }
}

export default Todo_Item
